import React from 'react';
import './Techstack.css';

const Techstack = () => {

    const data = [

        {
            name: "HTML",
            icon: ""
        },
        {
            name: "CSS",
            icon: ""
        },
        {
            name: "Javascript",
            icon: ""
        },
        {
            name: "Typescript",
            icon: ""
        },
        {
            name: "ReactJs",
            icon: ""
        },
        {
            name: "Angular",
            icon: ""
        },
        {
            name: "Python",
            icon: ""
        },
        {
            name: "Flask",
            icon: ""
        },
        {
            name: "SQL",
            icon: ""
        }

    ]

  return (
    <div className='container techstack-section'>
        <div className='section-title'>
            <h5>Tech Stack</h5>
            <span id='line'></span>
        </div>
        <div className='row'>
            {data.map((item, index) => {
                <div className='col-xl-4 col-lg-4 col-md-6 col-sm-12'>
                    <div className='techstack-content'></div>
                </div>
            })}
        </div>
    </div>
  )
}

export default Techstack
